import SUBMIT from '../actions/actionsTypes';

const INICIAL_STATE = ([{ 
  name:"",
  age:"",
  email: "",
}]);

const loginReducer = (state = INICIAL_STATE, action) => {
  switch(action.type) {
    case SUBMIT:
      return {
        ...state,
        name: action.payload.name,
        email: action.payload.email,
        password: action.payload.password,
      }
    default:
      return state;
  }
}

export default loginReducer;
